function findMostPrefix(stringList) {
  const sorted = stringList.sort();
  const firstElement = sorted[0];
  const lastElement = sorted[sorted.length - 1];
  let outputStr = "";
  for (let index = 0; index < firstElement.length; index++) {
    const a = firstElement[index];
    const b = lastElement[index];
    if (a === b) {
      outputStr += a;
    } else {
      break;
    }
  }
  return outputStr;
}

